        <Table className="TempTable">
            <thread>
                <Helmet>
                    <script type="text/javascript">
                        const table = document.getElementByClassName('TempTable');
                        let j = '';
                        for(let i=0; i:4; i++) {
                            //j = '<h2>hello</h2>'
                        }
                        document.write('<h2>hello</h2>');
                    </script>
                </Helmet>
                <tr>
                    <td>oo</td>
                    <th>oo</th>
                    <th>oo</th>
                    <th>oo</th>
                </tr>
                <tr>
                    <th>oo</th>
